{
	function getNumbers(x) {
		let element = typeof x === 'string' ? document.getElementById(x) : x;
		return element.textContent.match(/(?:Infinite)|(?:\d+(?:\.\d+)?(?:e\d+)?%?)/g).map(number => {
			if (number.toLowerCase() === 'infinite') {
				return 1.79e308;
			}
			let r = 1;
			if (number.endsWith('%')) {
				number = number.slice(0, -1);
				r = 0.01;
			}
			return Number(number) * r;
		});
	}
	function action(x, cost) {
		let element = typeof x === 'string' ? document.getElementById(x) : x;
		let result = () => {
			element.click();
		};
		if (cost !== null) {
			result.cost = cost || getNumbers(x)[0];
		}
		result.able = element.style.display !== 'none'
			&& !element.classList.contains('unavailablebtn')
			&& !element.classList.contains('infinistorebtnlocked');
		return result;
	}
	(typeof module === 'object' ? module.exports : window).Game = class Game {
		static get antimatter() {
			const [amount] = getNumbers('coinAmount');
			const [delta] = getNumbers('coinsPerSec');
			return {
				amount,
				delta,
			};
		}
		static get tick() {
			const [a, b = 1] = getNumbers('tickSpeedAmount');
			const amount = a / b;
			const buyMax = action('tickSpeed');
			const max = action('tickSpeedMax', null);
			const [effect] = getNumbers('tickLabel');
			return {
				amount,
				effect,
				buyMax,
				max,
			};
		}
		static get dimensions() {
			const tbody = document.getElementById('parent');
			function getDimension(row) {
				const cells = Array.from(row.children);
				const [mul] = getNumbers(cells[0]);
				const [amount, , p] = getNumbers(cells[1]);
				const [, tenCost] = getNumbers(cells[3]);
				const buy = action(cells[2].children[0]);
				const buyToTen = action(cells[3].children[0], tenCost);
				return {
					amount,
					delta: amount * p,
					mul,
					buy,
					buyToTen,
				};
			}
			let dims = [];
			for (let row of Array.from(tbody.children)) {
				if (row.style.display === 'none') {
					break;
				}
				dims.push(getDimension(row));
			}
			return dims;
		}
		static get translation() {
			const [amount, cost] = getNumbers('resetLabel');
			const buy = action('softReset', cost);
			return {
				amount,
				buy,
			};
		}
		static get galaxy() {
			const [amount, cost] = getNumbers('secondResetLabel');
			const buy = action('secondSoftReset', cost);
			return {
				amount,
				buy,
			};
		}
		static get maxAll() {
			return action('maxall', null);
		}
		static get sacrifice() {
			let result = action('sacrifice', null);
			([result.effect] = getNumbers('sacrifice'));
			return result;
		}
		static get bigCrunch() {
			return action('bigcrunch', null);
		}
	};
}
if (typeof window.interval === 'number') {
	clearInterval(window.interval);
	delete window.interval;
}
window.interval = setInterval(() => {
	if (Game.bigCrunch.able) {
		Game.bigCrunch();
	}
	if (Game.galaxy.buy.able && Game.galaxy.amount < 2) {
		Game.galaxy.buy();
		return;
	}
	if (Game.translation.buy.able) {
		Game.translation.buy();
		return;
	}
	if (Game.sacrifice.able && Game.antimatter.delta < Game.antimatter.amount && Game.sacrifice.effect >= 2) {
		Game.sacrifice();
		return;
	}
	let dims = Game.dimensions;
	let dimCount = dims.length;
	let lastDim = dims[dimCount - 1];
	if (lastDim.amount === 0 && lastDim.buy.able) {
		if (lastDim.buyToTen.able) {
			lastDim.buyToTen();
		}
		else {
			lastDim.buy();
		}
	}
	if (Game.tick.buyMax.able) {
		Game.tick.buyMax();
	}
	for (let i = dimCount - 1; i >= 0; i--) {
		if (dims[i].buyToTen.able) {
			dims[i].buyToTen();
		}
	}
	for (let i = dimCount - 1; i >= 0; i--) {
		let dim = dims[i];
		if (dim.buy.able) {
			dim.buy();
		}
		else if (dim.amount > 0) {
			break;
		}
	}
}, 0);

